import React, { useState } from "react";
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import { Grid } from "@mui/material";
import MDTypography from "components/MDTypography";
import MDBox from "components/MDBox";
import MDButton from "components/MDButton";
import ComplexStatisticsCard from "examples/Cards/StatisticsCards/ComplexStatisticsCard";
import Icon from "@mui/material/Icon";
import TextField from "@mui/material/TextField";
const FeedMachine = () => {


      const [feedAdded , setFeedAdded] = useState(null)
      const [showFeedInput, setShowFeedInput] = useState(false);


      const handleFeedAdd = (event) => {
        setFeedAdded(event.target.value);

      };
      const handleFeedClick = () => {
        setShowFeedInput(false);
      };

      const handleFeedMachine=() => {
            setShowFeedInput(true);
      };
      const handleCloseFeed=() => {
            setShowFeedInput(false);
      };
      return (
            <DashboardLayout>
              <DashboardNavbar />
                <MDBox py={3}>
                  <Grid container spacing={3}>
                    <Grid item xs={12} md={6} lg={3}>
                          <MDBox mb={1.5} className="uploadForTrain" onClick={handleFeedMachine}>
                            <ComplexStatisticsCard className="desable-uploaded" color="dark" icon="keyboard" title="Feed To Machine" />
                          </MDBox>
                    </Grid>
                  </Grid>




                        {showFeedInput?(
                        <div className='modal'>
                          <div className='modal-content'>
                          <div className="close-div">
                          <button className="close-button" icon="close" onClick={handleCloseFeed}>
                            <Icon>close</Icon>
                          </button>
                          </div>
                          <Grid item>
                            <MDTypography variant="h6" fontWeight="medium" textTransform="capitalize" textAlign="center" >
                              Enter Feed
                            </MDTypography>
                            <MDBox pt={4} pb={3} px={3}>
                              <MDBox component="form" role="form">
                                <MDBox mb={2}>
                                <TextField id="outlined-multiline-static" label="Add Feed" multiline rows={4} fullWidth variant="outlined" value={feedAdded} onChange={handleFeedAdd}/>                                
                                </MDBox>
                                <MDBox mt={4} mb={1}>
                                  <MDButton variant="gradient" color="info" fullWidth onClick={handleFeedClick}>
                                    Feed
                                  </MDButton>
                                </MDBox>
                              </MDBox>
                            </MDBox>
                          </Grid>
                          </div> 
                      </div>
                    ):<></>}
                </MDBox>
            {/*  Snack BARS===========================================================================================> */}

                {/* <MDSnackbar
                   color="success"
                   icon="check"
                   title="Updated"
                   content="Profile Updated Successfully!"
                   dateTime="Now"
                   open={SuccessUpdateUser}
                   onClose={closeWarningSB}
                   close={closeWarningSB}
                   bgWhite
                 />
                  <MDSnackbar
                   color="error"
                   icon="error"
                   title="Error"
                   content="Something Went worng!"
                   dateTime="Now"
                   open={ErrorUpdateUser}
                   onClose={closeWarningSB}
                   close={closeWarningSB}
                   bgWhite
                 /> */}
               {/* SNACK BARS Closed =---------------------------------------------------------- */}
            </DashboardLayout>
      )
}
export default FeedMachine;
